commentaire:
Trade coupé parce que :
-la notion selon laquelle le sommet récent n\'a pas créé un sommet plus haut que le sommet précédent donc le dernier creux a une grande chance d\'être cassé n\'a pas été prise en compte par moi;
-le marché ne m\'a pas convaincu dans sa volonté à évoluer à la hausse depuis ma prise de position du faite que les bougies H4 n\'ont pas montré de gros corps.
